export const GET_WORD = 'GET_WORD';
export const getWord = word => ({
  type: GET_WORD,
  word
});
export const SET_USER_INPUT = 'SET_USER_INPUT';
export const setUserInput = userInput => ({
  type: SET_USER_INPUT,
  userInput
});
